@pic101 it helps me as a beginner. but also often confuses me. as im not always capable of seeing mistakes. So i have to be extra careful.
So ye, i guess a beginner will work faster making beginner code. But it wont make them faster making better code. 
It would also help an expert making more and faster expert code i guess. But it will never make my apps professional and well coded for that matter imho. As im a beginner, it frequently reflects my skill level.

@mattpocockuk Look, man, with all due respect you deserve, but the scope of possibilities was aways there, for anyone that would risk it. So much that absolutely everything we may talk about was, once, a crazy idea.

I don't dislike AI. I use ChatGPT to help me with specific tasks, but that's it. IMO, abusive use of AI, especially to kick start AND finish some software, will mask an individual's lack of ability under a supposedly achievement pane. 


I understand you're focused on helping other achieve a greater level of efficiency by teaching how to better make use of AI etc, but I can't help pointing out that, sometimes, and for me, this seems to be case, teaching how to fish is a better option, for harder it may seem, than teaching how to order a ready made meal.
